    [],nt"revision_timestamp": "2016-07-27T23:03:25.254132",nt"name": "back-bay-nwr-neotropical-landbird-survey",nt"isopen":
    false,nt"url": null,nt"notes": "The neotropical/landbird survey was performed
    to collect baseline data for both migratory and resident birds on the refuge. The
    data are useful for monitoring species presence, species habitat association, and
    population trends over the years. An important goal of the survey is to identify
    species of concern and to associate these species with habitat preference for future
    conservation and management purposes.Species of management concern are those that
    have shown significant population declines in the North American Breeding Bird Survey
    since 1966, or have been listed as threatened, endangered, or a species of concern
    by the state of Virginia or the US Fish and Wildlife Service (Table 1).",nt"license_title":
